Jaane Bhi Do Yaaro is a 1983 Hindi film directed by Kundan Shah and produced by NFDC.


It is a dark satire on the rampant corruption in Indian politics, bureaucracy, news media and business, and stars an ensemble cast that includes the likes of Naseeruddin Shah, Ravi Baswani, Om Puri, Pankaj Kapur, Satish Shah, Satish Kaushik, Bhakti Barve and Neena Gupta.

